import React from 'react';

import { Container, Wrapper, OldPrice, NewPrice, Description, Button, Image, PartPrice, Favourite } from './styles';


function Carrocel({ img, oldPrice,
    newPrice,
    partPrice,
    description,
    key ,
}) {
  return(
      <Container key={key}>
        <Wrapper>
            <Image src={window.location.origin + img} alt="imagem"/>

            <OldPrice>
               {oldPrice}
            </OldPrice>

            <NewPrice>
                {newPrice}
            </NewPrice>

            <PartPrice>
                {partPrice}
            </PartPrice>

            <Description>
                <p>
                    {description}
                </p>
                <Favourite />
            </Description>

            <Button>
                Comprar
            </Button>
        </Wrapper>
      </Container>
  );
}

export default Carrocel;
